Storyline:

    In 1942 Czechoslovakia, SS-General Reinhard Heydrich is appointed to become the Reich Protector of Bohemia and Moravia. The terror and oppression that follow cause Allied authorities in London to authorize a secret mission to kill the man who has come to be known as &quot;The Butcher of Prague&quot;. The film explores shows the operation leading up to Heydrich's death as well as the massive German reprisals that followed it.




